text:
LE PRESIDENT DE LA REPUBLIQUE,
VU la Constitution ;
VU la loi n°2002/011 du 30 décembre 2002 autorisant le Président de la République à ratifier le Protocole portant amendement de l'article 56 de la Convention relative à l'Aviation Civile Internationale, signé a Montréal le 6 octobre 1989 ;
DECRETE:
Art. 1 —  - Est ratifié le Protocole portant amendement de l'article 56 de la Convention relative à l'Aviation Civile Internationale, signé à Montréal le 6 octobre 1989.
Art. 2 —  - Le présent décret sera enregistré et publié suivant la procédure d'urgence, puis inséré au Journal Officiel en français et en anglais.
